import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const AddCaseForm = () => {
  const [petitionerFirstName, setPetitionerFirstName] = useState('');
  const [petitionerLastName, setPetitionerLastName] = useState('');
  const [address, setAddress] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [dateOfFiling, setDateOfFiling] = useState('');
  const [caseType, setCaseType] = useState('');
  const [caseStatus, setCaseStatus] = useState('');
  const [caseDescription, setCaseDescription] = useState('');

  const navigate = useNavigate();

  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle form submission logic here, e.g., send data to API
    console.log('Form submitted:', {
      petitionerFirstName,
      petitionerLastName,
      address,
      phoneNumber,
      dateOfFiling,
      caseType,
      caseStatus,
      caseDescription,
    });
  };

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <div className="flex flex-wrap justify-center mt-4">
      {/* Sidebar */}
      <div className="w-64 bg-gray-100 p-4 mb-4 lg:mb-0 lg:mr-8">
        <h2 className="text-lg font-bold mb-4">Application Name</h2>
        <ul className="space-y-2">
          <li>
            <button
              className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
              onClick={() => handleNavigation('/assign-roles')}
            >
              Assign Roles
            </button>
          </li>
          <li>
            <button
              className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
              onClick={() => handleNavigation('/create-case')}
            >
              Create Case
            </button>
          </li>
        </ul>
        <hr className="my-4" />
        <ul className="space-y-2">
          <li>
            <button
              className="text-gray-700 hover:text-gray-900 font-bold py-2 px-4 rounded"
              onClick={() => handleNavigation('/options')}
            >
              Options
            </button>
          </li>
          <li>
            <button
              className="text-gray-700 hover:text-gray-900 font-bold py-2 px-4 rounded"
              onClick={() => handleNavigation('/roles')}
            >
              Roles
            </button>
          </li>
          <li>
            <button
              className="text-gray-700 hover:text-gray-900 font-bold py-2 px-4 rounded"
              onClick={() => handleNavigation('/users')}
            >
              Users
            </button>
          </li>
          <li>
            <button
              className="text-gray-700 hover:text-gray-900 font-bold py-2 px-4 rounded"
              onClick={() => handleNavigation('/cases')}
            >
              Cases
            </button>
          </li>
        </ul>
        <hr className="my-4" />
        <ul className="space-y-2">
          <li>
            <button
              className="text-gray-700 hover:text-gray-900 font-bold py-2 px-4 rounded"
              onClick={() => handleNavigation('/settings')}
            >
              Settings
            </button>
          </li>
          <li>
            <button
              className="text-gray-700 hover:text-gray-900 font-bold py-2 px-4 rounded"
              onClick={() => handleNavigation('/logout')}
            >
              Logout
            </button>
          </li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="flex-1 p-8 lg:p-12">
        <div className="max-w-2xl mx-auto bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
          <h2 className="text-2xl font-bold mb-6">Add Cases</h2>
          <form onSubmit={handleSubmit} className="space-y-6">
            {/* Form fields */}
          </form>
        </div>
      </div>
    </div>
  );
};

export default AddCaseForm;
